package com.kuaixiu.prizechance.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-11-07 下午05:21:23 * @version: V 1.0 */public class PrizeChance extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * id     */    private String id ;    /**     * 抽奖手机号     */    private String userMobile ;    /**     * 剩余抽奖次数     */    private Integer count ;    /**     *      */    private String creator ;    /**     * 创建时间     */    private java.util.Date createTime ;    /**     *      */    private String updator ;    /**     * 修改时间     */    private java.util.Date updateTime ;    /**     * 0未删除  1已删除     */    private Integer isDel ;    /**     * 类别     * @return     */    private  String type;    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getId(){        return this.id;    }    public void setId(String id){        this.id=id;    }    public String getUserMobile(){        return this.userMobile;    }    public void setUserMobile(String userMobile){        this.userMobile=userMobile;    }    public Integer getCount(){        return this.count;    }    public void setCount(Integer count){        this.count=count;    }    public String getCreator(){        return this.creator;    }    public void setCreator(String creator){        this.creator=creator;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    public String getUpdator(){        return this.updator;    }    public void setUpdator(String updator){        this.updator=updator;    }    public java.util.Date getUpdateTime(){        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }    public Integer getIsDel(){        return this.isDel;    }    public void setIsDel(Integer isDel){        this.isDel=isDel;    }}